import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import PersonIcon from '@material-ui/icons/Person';
import { grey } from '@material-ui/core/colors';
import Avatar from '@material-ui/core/Avatar';
import UploadButton from './uploadbutton_ver2';
import Divider from '@material-ui/core/Divider';
import ResultTable from './resulttable';
import BackupOutlinedIcon from '@material-ui/icons/BackupOutlined';
import FileList from './filelist';
import KPMGlogo from '../../static/KPMG_logo_white.svg';
import PopUp from './popup';

const user = "user_name";

const useStyles = makeStyles((theme) => ({
    root: {
        textAlign: 'center',
        height: '100%',
        width: '100%',
    },
    titleContainer: {
        color: 'white',
        paddingTop: theme.spacing(6),
        paddingBottom: theme.spacing(2),
    },
    uploadContainer: {
    },
    dataContainer: {
        backgroundColor: 'rgba(107, 186, 167, 0.5)',
    },
    container: {
    },
    dataTable: {
        display: 'flex',
        flexDirection: 'row',
    },
    divider: {
        marginLeft: "15%",
        marginRight: "15%",
        backgroundColor: '#f5f5f5',
    },
    box: {
        display: 'flex'
    }
}));



export default function Main() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <div className={classes.titleContainer}>
                <Container maxWidth="lg" className={classes.container}>
                    <Grid container direction="row" justify="center" alignItems="center" >
                        <Grid item xs={3}>
                            <a href="/"><img src={KPMGlogo} alt="KPMG_logo" width='150px' /></a>
                        </Grid>
                        <Divider orientation="vertical" flexItem className={classes.divider} color='secondary.light' />
                        <Grid item xs={3}>
                            <div style={{ fontSize: '55px' }}>Libor</div>
                        </Grid>
                        <Divider orientation="vertical" flexItem className={classes.divider} color='secondary.light' />
                        <Grid item xs={3}></Grid>
                    </Grid>
                </Container>
            </div>
            <div className={classes.dataContainer}>
                <Container maxWidth="lg" className={classes.container}>
                    <Box height={670} className={classes.dataTable}>
                        <div>
                            file list
                             </div>
                        <div>
                            result value table
                             </div>
                    </Box>
                </Container>
            </div>

            <div className={classes.uploadContainer}>
                <Container maxWidth="lg" className={classes.container}>
                    <Box height={120}> <UploadButton /></Box>
                </Container>
            </div>
        </div>
    );
}
